import React from 'react'
import styled from 'styled-components'

const Ul = styled.ul`
ul {
list-style: none;
}`

const NavBar = () => {
    return (
        <div>
         <ul>
             <li>Home</li>
             <li>Skills</li>
             <li>Background</li>
             <li>Contact</li>
         </ul>
        </div>
    )
}

export default NavBar
